import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css"; // Assuming you have global styles here or in a separate file
import App from "./App";
import Web from "./Web";
import Login from "./page/Login"; // Corrected path from 'pages' to 'page'
import Register from "./page/Register"; // Corrected path from 'pages' to 'page'
import { AuthWrapper } from "./context/AuthContext";
import HomePage from "./pages/HomePage";
import FoodDetail from "./pages/FoodDetail";
import Recommendations from "./pages/Recommendations";
import FavoriteFood from "./pages/FavoriteFood";
import CreateFoodPage from "./pages/CreateFood";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <AuthWrapper>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<App />} />
          <Route path="/web" element={<Web />}>
            <Route path="home" element={<HomePage />} />
            <Route path="/foods/:id" element={<FoodDetail />} />
            <Route path="/recommendation" element={<Recommendations />} />
            <Route path="/favorite" element={<FavoriteFood />} />
            <Route path="create" element={<CreateFoodPage />} />
          </Route>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </BrowserRouter>
    </AuthWrapper>
  </React.StrictMode>
);
